import React, { Component } from "react";
import Colorback from "./Colorback";
import { Link } from "react-router-dom";
import { Switch, Route } from "react-router-dom";
import Strange from "./projects/Strange";
import Sketchup from "./projects/Sketchup";
import Shoot from "./projects/Shoot";
import Grimeton from "./projects/Grimeton";
import Falcon from "./projects/Falcon";
import Cosmos from "./projects/Cosmos";
import Archrenderings from "./projects/Archrenderings";
import Block from "./projects/Block";

export default class Projects extends Component {
  render() {
    return (
      <div className="App">
        <h1>hello projects</h1>
        <div className="pnav">
          <Link className="plink" to="/projects/strange">
            So Strange Loops
          </Link>
          <Link className="plink" to="/projects/Shoot">
            "Can You Shoot Me an Alphabet?"
          </Link>
          <Link className="plink" to="/projects/sketchup">
            Sketchup Explorations
          </Link>
          <Link className="plink" to="/projects/grimeton">
            Grimeton Identity
          </Link>
          <Link className="plink" to="/projects/falcon">
            Falconers Code
          </Link>
          <Link className="plink" to="/projects/cosmos">
            Cosmos Book
          </Link>
          <Link className="plink" to="/projects/arch">
            "This Should be a Park"
          </Link>
          <Link className="plink" to="/projects/block">
            Block
          </Link>
        </div>
        <br />
        {/* <Colorback /> */}
      </div>
    );
  }
}
